import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection'
import Cards from '../Cards';
import Footer from '../Footer';

function Home () {
    return (
        <>
            <div id="aboutme">
                <HeroSection/>
            </div>
            <div id="projects">
                <Cards/>
            </div>
            <div id="footer">
                <Footer/>
            </div>
            <div id="skills">
                <Skills/>
            </div>
        </>
    )
}

export default Home;
